import './Footer.scss';
import React from 'react';
import NavButton from '../layout/button/NavButton';
import { NavLink } from 'react-router-dom';
import NavLinkTemplate from '../layout/navLink/NavLinkTemplate';

const Footer= () => {
    return (
        <footer className='footer'>
            <li><NavLinkTemplate content={'Contact us'} to={'/ContactUs'}></NavLinkTemplate></li>
            <li></li><NavLinkTemplate content={'Terms of Use'} to={'/TermsOfUse'}></NavLinkTemplate>
            <li></li><NavLinkTemplate content={'Privacy Policy'} to={'/PrivacyPolicy'}></NavLinkTemplate>
        </footer>
    )
}

export default Footer;
